import React, { Component } from "react";
import { Row, Col, Container, Button } from "react-bootstrap";

class RobotState extends Component {
  state = {
    x: 0,
    y: 0,
    gps_latitude: 0,
    gps_longitude: 0,
  };
  render() {
    return (
      <div>
        <Row>
          <Col>
            <h2>Teleoperation</h2>
            <p className="mt-0">x:{this.state.x} , y:0 , z:0</p>
            <p className="mt-0">Velocity:</p>
            <p className="mt-0">Latitude: , Longitude: </p>
            <p className="mt-0">Battery:</p>
          </Col>
        </Row>
      </div>
    );
  }
}

export default RobotState;
